import React from 'react';

function VideoGrid (props) {
  const videoList = props.videoList
  let inputVideoList = videoList.map((video) =>
  <div className="videoList" key={video}>
    <img src={video[0]} />
    <div className="name">
      {video[1]}
    </div>
    <div className="chanel">
      {video[2]}
    </div>
  </div>)
  return (
      <div className="video">
        {inputVideoList}
      </div>
  )
}

export default VideoGrid
